import React, {Component} from 'react';
import Navbar from './Navbar';
import './Me.css';

class Me extends Component {
    render() {
        return (
            <div> 
                <Navbar page="projects"/>
                <div className="projectsPage">
                    <h1 className="projectsHeader"> PROJECTS
                    </h1>
                </div>    
            </div>
        );
    }
}

export default Me;
